import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'MailingListWebApp';
}


<mat-card class="MailingListAddCard">
  <mat-card-content>
    <button mat-raised-button color="primary">Want to be added to the mailing list?</button>
  </mat-card-content>
</mat-card>
